import React from 'react';
import my_photo from '../assets/my_photo.jpeg';

const Home = () => {
  return (
    <div className='bg-white max-w-[1200px] h-[80vh] mx-auto flex flex-col-reverse sm:flex-row justify-center items-center'>
      <div className='text-8xl'>Hy</div>
      <div className='my-auto'>
        <img className='w-[300px] sm:w-[500px] mx-auto h-auto rounded-full' src={my_photo} alt="profile image" />
      </div>
    </div>
  );
}

export default Home;
